import React from 'react'
import { Link } from 'react-router-dom'

export default function NavbarC() {
  return (
    <div>
        <Link to='/poke'>Pokemon</Link>
        <Link to='/'>Heading</Link>
        <br></br>
        <a href='/poke'>Pokemon</a>
        <a href='/'>Heading</a>
    </div>
  )
}
